import React from "react";
import {
  SiteLogo,
  NavLinks,
  PhoneIcon,
  StyledNavbar
} from "./styles/Navbar.styled";
import { Btn, Flex, FlexItem } from "../../styles/general/General.styled";
import { StyledLink } from "../../styles/general/General.styled";

const Navbar = () => {
  return (
    <StyledNavbar>
      <Flex ai="center">
        <PhoneIcon />
        <FlexItem fg="1">
          <SiteLogo>
            <StyledLink to="/">OCA</StyledLink>
          </SiteLogo>
        </FlexItem>
        <NavLinks>
          <Flex ai="center">
            <Btn>Features</Btn>
            <Btn>Get Chrome Extension</Btn>
            <StyledLink to="/signin">
              <Btn>Sign In</Btn>
            </StyledLink>
          </Flex>
        </NavLinks>
      </Flex>
    </StyledNavbar>
  );
};

export default Navbar;
